import React, { memo } from 'react';
import Layout from '../../components/shared/Layout/Layout'

const About = memo(() => {
  return (
    <Layout>
    <div className="home">
        <img className="avatar" src="https://i.imgur.com/eOu7oq3.png" alt-text=""></img>
        <p></p>
    </div>
  </Layout>
  );
});

export default About;
